import Buttons from "../elements/Buttons";
import MowingHours from "../inputs/MowingHours";
import Inputs from "../inputs/Inputs";

const Step5 = ({
  whichStep,
  setWhichStep,
  handleChange,
  buttonClick,
  setCustomerInputs,
  setPADDRegion,
  customerInputs,
}) => {
  return (
    <div className="main container-inputs">
      <h2>Step5</h2>
      <ul className="inputs" id="inputs">
        <li className="column">
          <MowingHours {...{ handleChange, buttonClick, edit: 1 }} />
        </li>
      </ul>
      <Buttons {...{ whichStep, setWhichStep }} />
      <Inputs {...{ setPADDRegion, customerInputs, setCustomerInputs }} />
    </div>
  );
};

